import React from 'react';
import { BrowserRouter, Link, Route, Routes } from 'react-router-dom';
import About from './pages/About';

const App = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<About />} />
            </Routes>
        </BrowserRouter>
    );
};

export default App;
